Spree.Models.Shipment = Backbone.Model.extend({
  idAttribute: "number",
  paramRoot: "shipment",
  urlRoot: Spree.pathFor('api/shipments'),

  relations: {
    "selected_shipping_rate": Backbone.Model,
    "shipping_rates": Backbone.Collection,
  },

  estimatedRates: function() {
    var ratesCollection = Backbone.Collection.extend({
      parse: function(resp){ return resp.shipping_rates }
    });
    var rates = new ratesCollection();
    rates.fetch({ url: this.url() + "/estimated_rates" })
    return rates;
  },

  selectShippingMethodId: function(shippingMethodId, options) {
    this.sync("update", this, _.extend({
      url: this.url() + "/select_shipping_method",
      contentType: 'application/json',
      data: JSON.stringify({ shipping_method_id: shippingMethodId })
    }, options));
  }
});

Spree.Collections.Shipments = Backbone.Collection.extend({
  model: Spree.Models.Shipment
});
Spree.Models.Address = Backbone.Model.extend({
});




Spree.Models.Order = Backbone.Model.extend({
  urlRoot: Spree.pathFor('api/orders'),
  idAttribute: "number",

  relations: {
    "line_items": Spree.Collections.LineItems,
    "shipments": Spree.Collections.Shipments,
    "bill_address": Spree.Models.Address,
    "ship_address": Spree.Models.Address
  },

  advance: function(opts) {
    var options = {
      url: Spree.pathFor('api/checkouts/' + this.id + '/advance'),
      type: 'PUT',
    };
    _.extend(options, opts);
    return this.fetch(options)
  },

  empty: function (opts) {
    var options = {
      url: Spree.pathFor('api/orders/' + this.id + '/empty'),
      type: 'PUT',
    };
    _.extend(options, opts);
    return this.fetch(options)
  }
});

Spree.Models.Order.fetch = function(number, opts) {
  var options = (opts || {});
  var model = new Spree.Models.Order({
    number: number,
    line_items: [],
    shipments: [],
    bill_address: {},
    ship_address: {},
  });
  model.fetch(options);
  return model;
};
