Spree.Views.Tables.SelectableTable = Backbone.View.extend({
  events: {
    'change .selectable': 'onSelectedItem',
  },

  initialize: function() {
    this.model = new Backbone.Model({
      allSelected: false,
      selectedItems: []
    });

    this.listenTo(this.model, 'change', this.detectChanges)

    this.render();
    Backbone.trigger("selectableTable:init", this)
  },

  onSelectedItem: function(event) {
    var item = event.currentTarget;
    if(item.checked) {
      this.addItem(item)
    }else{
      this.$el.find('input[name="select-all"]').prop('checked', false);
      this.removeItem(item)
    }
  },

  addItem: function(item) {
    var items = _(this.model.get('selectedItems')).clone();
    if(items.indexOf(item) === -1) {
      items.push(item);
      this.model.set('selectedItems', items);
    }
  },

  removeItem: function(item) {
    var items = _(this.model.get('selectedItems')).clone();
    items.splice(items.indexOf(item), 1);
    this.model.set('selectedItems', items);
    this.model.set('allSelected', false);
  },

  maxColumns: function() {
    var max = 0;
    this.$el.find('tr').each(function(){
      var inTr = 0;
      $('td,th', this).each(function() { inTr += parseInt($(this).attr('colspan')) || 1 });
      max = Math.max(max,inTr);
    });

    return max;
  },

  detectChanges: function(model) {
    var selectableTable = this;
    if(model.changed.allSelected == true) {
      $('.selectable').each(function(_, item) { selectableTable.addItem(item) })
    }

    this.render();
  },

  render: function(){
    var model = this.model;

    this.$el.find('.selectable').each(function(_i, checkbox){
      checkbox.checked = model.get('allSelected') || model.get('selectedItems').includes(checkbox);
    })
  }
});
Spree.Views.Tables.SelectableTable.Summary = Backbone.View.extend({
  events: {
    'click input[name="select-all"]': 'onSelectedAll'
  },

  onSelectedAll: function(event) {
    this.model.set('allSelected', event.currentTarget.checked);
    if(event.currentTarget.checked == false) {
      this.model.set('selectedItems', []);
    }
  },

  initialize: function(options) {
    this.listenTo(this.model, 'change', this.render)

    this.colspan = options.columns - 1;

    this.render();
  },

  render: function() {
    var selectedItemLength = this.model.get('selectedItems').length;
    var all_items_selected = this.model.get('allSelected');

    var html = HandlebarsTemplates['tables/selectable_label']({
      colspan: this.colspan,
      item_selected_label: this.selectedItemLabel(all_items_selected, selectedItemLength),
      all_items_selected: all_items_selected
    });

    this.$el.html(html);
  },

  selectedItemLabel: function(all_selected, selected_item_length) {
    if(all_selected) {
      return Spree.t('items_selected.all');
    } else if(selected_item_length == 0) {
      return Spree.t('items_selected.none');
    } else if(selected_item_length == 1) {
      return Spree.t('items_selected.one');
    } else {
      return selected_item_length + " " + Spree.t('items_selected.custom');
    }
  }
});
Spree.Views.Tables.SelectableTable.SumReturnItemAmount = Backbone.View.extend({
  initialize: function(options) {
    this.listenTo(this.model, 'change', this.render);

    this.render();
  },

  render: function() {
    var html = HandlebarsTemplates['tables/return_item_sum_amount']({
      total_pre_tax_refund: Spree.t("total_pre_tax_refund"),
      total_selected_item_amount: this.totalSelectedReturnItemAmount()
    });

    this.$el.html(html);
  },

  totalSelectedReturnItemAmount: function () {
    var totalAmount = 0;
    var selectedItems = [];
    var decimals = 0;
    var separator = Spree.t('currency_separator');
    var amount, decimalAmount;

    if(this.model.get('allSelected')) {
      selectedItems = $('.selectable');
    } else {
      selectedItems = $(this.model.attributes.selectedItems);
    }
    selectedItems.each(function(_, selectedItem){
      amount = $(selectedItem).data('price');
      decimalAmount = amount.toString().split(separator)[1] || '';
      decimals = Math.max(decimals, decimalAmount.length);

      totalAmount += parseFloat(amount);
    })

    return accounting.formatNumber(totalAmount, decimals, Spree.t('currency_delimiter'), separator);
  },
});
































